DROP TABLE IF EXISTS `alipay_order_refund_record`;
CREATE TABLE `alipay_order_refund_record` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `notify_id` varchar(255) DEFAULT NULL COMMENT '通知校验ID。',
  `notify_time` varchar(255) DEFAULT NULL COMMENT '通知发送的时间。',
  `notify_type` varchar(255) DEFAULT NULL COMMENT '通知的类型。',
