  PRIMARY KEY (`id`),
  KEY `index_alipay_order_refund_record_notify_id` (`notify_id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8 COMMENT='支付宝-订单退款记录';

