-- ----------------------------
-- Table structure for `project`
-- ----------------------------
DROP TABLE IF EXISTS `project`;
CREATE TABLE `project` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) DEFAULT NULL COMMENT '发布人user_id',
  `aname` varchar(255) DEFAULT NULL COMMENT '初审名称',
  `acontext` varchar(255) DEFAULT NULL COMMENT '初审内容',
  `aphone` varchar(45) DEFAULT NULL COMMENT '初审电话',
  `afile` varchar(255) DEFAULT NULL COMMENT '初审附件',
  `name` varchar(255) DEFAULT NULL COMMENT '项目名称',
  `status` int(3) DEFAULT '0' COMMENT '项目状态 0-10',
  `category_id` bigint(20) DEFAULT '0' COMMENT '项目类别',
  `province` varchar(45) DEFAULT NULL COMMENT '省',
  `city` varchar(45) DEFAULT NULL COMMENT '市',
  `fundgoal` decimal(18,2) DEFAULT '0.00' COMMENT '目标资金',
  `fundnow` decimal(18,2) DEFAULT '0.00' COMMENT '已筹资金',
  `fundpcount` bigint(20) DEFAULT '0' COMMENT '参与筹集的人数',
  `starttime` bigint(20) DEFAULT NULL COMMENT '众筹项目启动时间',
  `expirestime` bigint(20) DEFAULT NULL COMMENT '众筹项目到期时间',
  `days` int(32) DEFAULT '0' COMMENT '众筹天数',
  `desc` varchar(255) DEFAULT NULL COMMENT '项目描述',
  `letter` varchar(255) DEFAULT NULL COMMENT '感谢信',
  `context` text COMMENT '项目详情',
  `cover_image` varchar(255) DEFAULT NULL COMMENT '封面图片',
  `images` varchar(500) DEFAULT NULL COMMENT '图片集合，用逗号分割',
  `video` varchar(255) DEFAULT NULL,
  `settlement` int(1) DEFAULT '0' COMMENT '是否已经结算（0：否，1：是）',
  `isdelete` int(1) DEFAULT '0' COMMENT '0未删除,1删除',
  `createtime` bigint(20) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `index_project_user_id` (`user_id`),
  KEY `index_project_status_category_id_isdelete` (`status`,`category_id`,`isdelete`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=211 DEFAULT CHARSET=utf8 COMMENT='项目信息';

