-- ----------------------------
-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `username` varchar(255) DEFAULT '' COMMENT '网站用户名',
  `password` varchar(255) DEFAULT NULL COMMENT '网站用户密码md5加密',
  `nickname` varchar(255) DEFAULT NULL COMMENT '网站用户昵称',
  `status` int(1) DEFAULT '1' COMMENT '用户状态（0--异常 1--正常）',
  `balance` decimal(18,2) DEFAULT '0.00' COMMENT '余额',
  `freeze_amount` decimal(18,2) DEFAULT '0.00' COMMENT '冻结金额',
  `picture` varchar(255) DEFAULT '' COMMENT '头像链接',
  `realname` varchar(45) DEFAULT NULL COMMENT '真实姓名',
  `sex` int(1) DEFAULT '3' COMMENT '性别，1：男，2：女,3：未知',
  `idtype` int(1) DEFAULT '0' COMMENT 'id类型,0身份证',
  `idphoto` varchar(255) DEFAULT NULL COMMENT '身份证照片',
  `birthday` bigint(20) DEFAULT NULL COMMENT '生日',
  `phone` varchar(45) DEFAULT NULL COMMENT '手机号',
  `email` varchar(45) DEFAULT NULL COMMENT '邮箱',
  `idno` varchar(45) DEFAULT NULL COMMENT '证件号码',
  `certify` int(1) DEFAULT '0' COMMENT '认证状态,0：未认证,1：申请中,2：认证通过  3 认证失败',
