  `province` varchar(255) DEFAULT NULL COMMENT '省份',
  `city` varchar(255) DEFAULT NULL COMMENT '城市/区县',
  `create_at` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `valid_email` varchar(45) DEFAULT NULL COMMENT '验证邮箱',
