  KEY `index_user_phone_password` (`phone`,`password`) USING BTREE,
  KEY `index_user_phone` (`phone`),
  KEY `index_user_email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=113 DEFAULT CHARSET=utf8 COMMENT='本地用户';

