  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) DEFAULT NULL COMMENT '用户id',
  `amount` decimal(18,2) DEFAULT NULL COMMENT '提现金额',
  `cost` decimal(18,2) DEFAULT NULL COMMENT '提现手续费',
  `status` int(1) DEFAULT NULL COMMENT '状态（0：待审核，1：审核通过，2：未通过，3：提现中，4：提现成功，5：提现失败）',
  `check_at` bigint(20) DEFAULT NULL COMMENT '审批时间',
  `type` int(1) DEFAULT NULL COMMENT '提现类型（1：支付宝）',
  `desc` varchar(255) DEFAULT NULL COMMENT '描述',
  `batch_no` varchar(255) DEFAULT NULL COMMENT '提现批次号',
  `operator` bigint(20) DEFAULT NULL COMMENT '操作人',
  `withdrawals_at` bigint(20) DEFAULT NULL COMMENT '提现发起时间',
  `withdrawals_success_at` bigint(20) DEFAULT NULL COMMENT '提现成功时间',
  `create_at` bigint(20) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `index_withdrawals_user_id` (`user_id`),
  KEY `index_withdrawals_batch_no` (`batch_no`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8 COMMENT='提现表';

