INSERT INTO `project` VALUES ('7', '1', 'MyTestProject7', '二十国集团（G20）财长和央行行长会议4日至5日在土耳其首都安卡拉举行。中国人民银行行长周小川和财政部部长楼继伟率中国代表团出席了会议。\r\n\r\n　　周小川在介绍近期中国金融市场情况时指出，今年6月中旬以前，中国股市泡沫不断积累。3月至6月，上证指数上涨了70%。在这一过程中，出现了投资者杠杆率快速上升等问题，存在风险隐患。6月中旬以来，中国股市发生了三轮调整，其中前两轮调整未有国际影响，8月下旬的第三轮调整产生了一些全球性影响。为避免发生系统性风险，中国政府采取了一系列政策措施。这些措施避免了股市断崖式下', '12312341234', null, '智能沙发', '9', '0', '340000', '340200', '2000.00', '266.00', '0', '1442019600000', '1449882000000', '30', '多美贷平台一周年庆活动上线', '地方司法考试的房间打扫', 'fdsfds', 'upload/images/20151013090657027-fc55c35a-3827-4c57.png', null, 'http://player.youku.com/player.php/sid/XMTMwMzM2MTA3Ng==/v.swf', '0', '0', '1442019600000');
