INSERT INTO `project` VALUES ('55', '7', 'ddsd', '瑟瑟发抖', '18040030416', 'upload/files/20151008180335252-044546ef-2ff8-464b.jpg', '我是一只小毛驴', '6', '4', '350000', '350500', '50000.00', '0.00', '0', null, null, '60', '旅游走遍天下', null, '<h3>\n	关于我\n</h3>\n<p>\n	向支持者介绍一下你自己，以及你与所发起的项目之间的背景。这样有助于拉近你与支持者之间的距离。建议不超过100字。\n</p>\n<h3>\n	我想要做什么\n</h3>\n<p>\n	以视频、图文并茂的方式简洁生动地说明你的项目，让大家一目了然，这会决定是否将你的项目描述继续看下去。建议不超过300字。\n</p>\n<h3>\n	项目的进展和风险\n</h3>\n<p>\n	让大家更好的了解项目的进度，增加对项目的信任度，以及在支持者选择支持前就了解和认同项目在执行过程中所存在的风险\n</p>\n<h3>\n	为什么需要你的支持\n</h3>\n<p>\n	这是加分项。说说你的项目不同寻常的特色、资金用途、以及大家支持你的理由。这会让更多人能够支持你，不超过200个汉字。\n</p>\n<h3>\n	我的承诺与回报\n</h3>\n<p>\n	让大家感到你对待项目的认真程度，鞭策你将项目执行最终成功。同时向大家展示一下你为支持者准备的回报，来吸引更多人支持你。\n</p>', 'upload/images/20151022144155254-232e9b02-dc24-4137.png', 'upload/images/20151022144159232-006a15e7-e78c-4f2b.png,upload/images/20151022144204460-b8ff98d6-e1a3-43f3.png,upload/images/20151022144208852-07f6326d-728b-490f.png', 'http://player.youku.com/player.php/sid/XMTMwMzM2MTA3Ng==/v.swf', '0', '0', '1444298617070');
